altimento acque, se la classificazione non è ancora definita (registrazione iniziale). La designazione fino al punto viene poi utilizzata dall''ingegnere idraulico per creare la topologia della rete fognaria. Per le ispezioni di pozzetti questo valore rimane in bianco.','rrr_Bezeichnung des "bis Punktes" einer Untersuchung, so wie sie auf dem Plan erscheint. Alternative zum Fremdschlüssel Abwasserbauwerk, wenn Topologie noch nicht definiert ist (Ersterfassung). Die bisPunktBezeichnung wird später vom Hydrauliker für den Aufbau der Kanalnetztopologie verwendet. Bei Schachtuntersuchungen bleibt dieser Wert leer.',ARRAY['kein_Plantyp_definiert']::tww_od.plantype[],'true','varchar(20)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
 INSERT INTO tww_sys.dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_name_ro, field_description_en, field_description_de, field_description_fr, field_description_it, field_description_ro, field_mandatory, field_visible, field_datatype, field_unit_en, field_unit_description_en, field_unit_de, field_unit_description_de, field_unit_fr, field_unit_description_fr, field_unit_it, field_unit_description_it, field_unit_ro, field_unit_description_ro, field_max, field_min) VALUES (3679,3688,'examination','vehicle','vehicle','Fahrzeug','VEHICULE','veicolo','rrr_Fahrzeug','yyy_Eingesetztes Inspektionsfahrzeug','Eingesetztes Inspektionsfahrzeug','Véhicule d’examen employé','Veicolo d’ispezione impiegato','rrr_Eingesetztes Inspektionsfahrzeug',ARRAY['kein_Plantyp_definiert']::tww_od.plantype[],'true','varchar(50)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
