 INSERT INTO tww_sys.dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_name_ro, field_description_en, field_description_de, field_description_fr, field_description_it, field_description_ro, field_mandatory, field_visible, field_datatype, field_unit_en, field_unit_description_en, field_unit_de, field_unit_description_de, field_unit_fr, field_unit_description_fr, field_unit_it, field_unit_description_it, field_unit_ro, field_unit_description_ro, field_max, field_min) VALUES (3705,8512,'damage','line_damage','line_damage','Streckenschaden','DOMMAGE_TRONCONS','danno_continuo','rrr_Streckenschaden','Codes for the beginning and end of a line damage. Detailed information under 2.1.2 resp. 3.1.2','Codes für den Anfang und das Ende eines Streckenschadens. Genaue Angaben unter 2.1.2 resp. 3.1.2','Codes pour le début et la fin d’un dommage à un tronçon. Indications exactes sous 2.1.2 resp. 3.1.2.','Codici di inizio e fine di un danno continuo. Indicazioni dettagliate al punto 2.1.2 o 3.1.2','rrr_Codes für den Anfang und das Ende eines Streckenschadens. Genaue Angaben unter 2.1.2 resp. 3.1.2',ARRAY['kein_Plantyp_definiert']::tww_od.plantype[],'true','varchar(3)',NULL,'Codes for the beginning and the end of a track damage',NULL,'Codes für den Anfang und das Ende eines Streckenschadens',NULL,'Codes pour le début et la fin d’un dommage tronçons',NULL,'Codici per l’inizio e la fine di un danno alla linea',NULL,'rrr_Codes für den Anfang und das Ende eines Streckenschadens',NULL,NULL);
 INSERT INTO tww_sys.dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_name_ro, field_description_en, field_description_de, field_description_fr, field_description_it, field_description_ro, field_mandatory, field_visible, field_datatype, field_unit_en, field_unit_description_en, field_unit_de, field_unit_description_de, field_unit_fr, field_unit_description_fr, field_unit_it, field_unit_description_it, field_unit_ro, field_unit_description_ro, field_max, field_min) VALUES (3705,9220,'damage','oid','oid','OID','OID','OID','OID','Stable unique object identification for all objects and classes','Stabile eindeutige Objektidentifikation für alle Objekte und Klassen','Identification d''objet unique stable pour tous les objets et toutes les classes','Identificazione univoca e stabile per tutti gli oggetti e le classi','Identificare unica stabila a obiectelor pentru toate obiectele ?i clasele',ARRAY['GEP_Verband','PAA','SAA']::tww_od.plantype[],'true','varchar(16)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
 INSERT INTO tww_sys.dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_name_ro, field_description_en, field_description_de, field_description_fr, field_description_it, field_description_ro, field_mandatory, field_visible, field_datatype, field_unit_en, field_unit_description_en, field_unit_de, field_unit_description_de, field_unit_fr, field_unit_description_fr, field_unit_it, field_unit_description_it, field_unit_ro, field_unit_description_ro, field_max, field_min) VALUES (3705,3706,'damage','single_damage_class','single_damage_class','Einzelschadenklasse','CLASSE_DOMMAGE_UNIQUE','classe_danno_singolo','clasa_de_dauna_individuala','Defines the damage class of an individual damage. The classification into condition classes (Z0-Z4) is based on the damage pattern and the extent of the damage. A wastewater structure can be directly assigned to a class or each damage can be classified individually first. (At the end, for example, the most severe individual damage determines the classification of the entire canalisation (wastewater_structure.structure_condition)).','Definiert die Schadensklasse eines Einzelschadens. Die Einteilung in die Zustandsklassen (Z0-Z4) erfolgt aufgrund des Schadenbilds und des Schadensausmasses. Dabei kann ein Abwasserbauwerk direkt einer Klasse zugeteilt werden oder zuerst jeder Schaden einzeln klassifiziert werden. (Am Schluss bestimmt dann z.B. der schwerste Einzelschaden die Klassifizierung des gesamten Kanals (Abwasserbauwerk.BaulicherZustand)).','Définit la classe de dommages d’un dommage unique. La répartition en classes d’état (Z0-Z4) s’effectue sur la base de la nature et de l’étendue des dommages. Un ouvrage d''assainissement peut être classé directement ou chaque dommage peut d’abord être classé séparément. (A la fin, le dommage le plus important détermine le classement de l’ensemble de la canalisation (OUVRAGE_RESEAU_AS.ETAT_CONSTRUCTIF).','Definisce la classe di danno di un danno isolato. La classificazione nelle classi di stato (Z0-Z4) si basa sul modello di danno e sull''entità del danno. Unamanufatto smaltimento acque può essere assegnata direttamente ad una classe o ogni danno può essere classificato singolarmente per primo. (Alla fine, ad esempio, il danno individuale più grave determina la classificazione dell''intera fogna (struttura fognaria.stato strutturale)).','Define?te clasa de dauna a unei daune individuale. Clasificarea în clase de stare (Z0-Z4) se bazeaza pe modelul de avarie ?i pe amploarea avariei. O structura de canalizare poate fi atribuita direct unei clase sau fiecare avarie poate fi clasificata mai întâi individual. (În final, de exemplu, cea mai grava avarie individuala determina clasificarea întregii canalizari (structura_canalizare.stare_structura)).',ARRAY['kein_Plantyp_definiert']::tww_od.plantype[],'true','integer',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
